'use client'
import React, {useState, useEffect} from 'react';

const CarteleraImagenes = () => {
    const imagenes = [
        'data:image/jpeg;base64,',
        'data:image/jpeg;base64,',
        'data:image/jpeg;base64,',
        // Agrega más imágenes según sea necesario
    ];

    const [imagenActual, setImagenActual] = useState(0);

    useEffect(() => {
        const interval = setInterval(() => {
            // Cambiar automáticamente la imagen cada 5 segundos (5000 ms)
            setImagenActual((prevImagen) =>
                prevImagen === imagenes.length - 1 ? 0 : prevImagen + 1
            );
        }, 7000);

        return () => clearInterval(interval); // Limpia el intervalo al desmontar el componente
    }, []);

    const mostrarImagenAnterior = () => {
        setImagenActual((prevImagen) =>
            prevImagen === 0 ? imagenes.length - 1 : prevImagen - 1
        );
    };

    const mostrarImagenSiguiente = () => {
        setImagenActual((prevImagen) =>
            prevImagen === imagenes.length - 1 ? 0 : prevImagen + 1
        );
    };

    return (
        <>
            <div className="flex items-center justify-center m-4">
                <button
                    onClick={mostrarImagenAnterior}
                    className="mr-4 text-5xl text-green-500"
                >
                    &#8592;
                </button>
                <img
                    src={imagenes[imagenActual]}
                    alt={`Imagen ${imagenActual + 1}`}
                    className="w-[600px] h-[350px] rounded-5"
                />
                <button
                    onClick={mostrarImagenSiguiente}
                    className="ml-4 text-5xl text-green-500"
                >
                    &#8594;
                </button>
            </div>

        </>

    );
};

export default CarteleraImagenes;

